import {ReactComponent as GithubIcon} from './assets/img/github.svg';

export default function Navbar(){
    return(
        <header>
     <nav>
       <div>
         <h1>DsMovie</h1>
         <a href="https://github.com/gabrields03">
         <div>
           <GithubIcon/>
           <p>/gabrields03</p>
         </div>
         </a>
       </div>
     </nav>
   </header>
    );
}
